import React from 'react';
class Header extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(

			<div className="header">
			<div className="logo">mary collins</div>
			<nav className="nav">
				<li>Work</li>
				<li>Skills</li>
				<li>About</li>
				<li>Contact</li>
			</nav>
			</div>
			);
	}
}
export default Header;
